import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';
import Cards from './card';
import 'tachyons';
import {robots} from './robots'

ReactDOM.render(
    <div>
        <Cards id={robots[0].id} name={robots[0].name} emale={robots[0].emale} />
        <Cards id={robots[1].id} name={robots[1].name} emale={robots[1].emale} />
        <Cards id={robots[2].id} name={robots[2].name} emale={robots[2].emale} />
        <Cards id={robots[3].id} name={robots[3].name} emale={robots[3].emale} />
        <Cards id={robots[4].id} name={robots[4].name} emale={robots[4].emale} />
        <Cards id={robots[5].id} name={robots[5].name} emale={robots[5].emale} />
        <Cards id={robots[6].id} name={robots[6].name} emale={robots[6].emale} />
        <Cards id={robots[7].id} name={robots[7].name} emale={robots[7].emale} />
        <Cards id={robots[8].id} name={robots[8].name} emale={robots[8].emale} />
        <Cards id={robots[9].id} name={robots[9].name} emale={robots[9].emale} />
    </div>,
    document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
